import { OrbitControls } from "three/examples/jsm/controls/OrbitControls";
import {
  Canvas,
  extend,
  useFrame,
  useLoader,
  useThree,
  useUpdate,
} from "react-three-fiber";
import HistoryItem from "./HistoryItem";

function App() {
  const [canvasItems, setCanvasItems] = useState([]);
  const [hoveredItem, setHoveredItem] = useState("na");
  const [menuHidden, setMenuHidden] = useState(false);
  const [historyData, setHistoryData] = useState(
    require("./static/trudy_history_embedded.csv")
  );

  let reader = new FileReader();
  reader.onload = async ({ target }) => {
    const csv = Papa.parse(target.result, { header: true });
    const parsedData = csv?.data;
    const columns = Object.keys(parsedData[0]);
    setData(columns);
  };
  reader.readAsText("./static/trudy_history_embedded.csv");

  console.log(historyData);
  return (
    <div className="bg-red-100">
      <Canvas>
        <OrbitControls />
        <ambientLight intensity={0.5} />
        <spotLight position={[100, 150, 100]} angle={0.3} />
        {/* <Physics> */}
        {/* <Box /> */}
        {historyData.map((item) => {
          return (
            <HistoryItem
              canvasProjects={historyData}
              setCanvasItems={setCanvasItems}
              project={item}
              hoveredItem={hoveredItem}
              setHoveredItem={setHoveredItem}
            />
          );
        })}

        {/* </Physics> */}
      </Canvas>
    </div>
  );
}

export default App;
